import tkinter as tk
import random
import pygame
import base64
from io import BytesIO


pygame.mixer.init()


miss_sound_data_uri = """data:audio/mpeg;base64,"""  
rage_sound_data_uri = """data:audio/mpeg;base64,"""  

def data_uri_to_sound(data_uri):
    """
    Convert data URI to a Pygame sound object.
    """
    header, encoded_data = data_uri.split(",", 1)
    audio_data = base64.b64decode(encoded_data)
    audio_file = BytesIO(audio_data)
    return pygame.mixer.Sound(audio_file)


miss_sound = data_uri_to_sound(miss_sound_data_uri)
rage_sound = data_uri_to_sound(rage_sound_data_uri)

class RageGame:
    def __init__(self, root):
        self.root = root
        self.root.title("Rage Game")
        self.root.geometry("600x600")
        
        
        self.canvas = tk.Canvas(self.root, width=600, height=600, bg="black")
        self.canvas.pack()
        
       
        self.target_radius = 30
        self.target = self.canvas.create_oval(0, 0, self.target_radius*2, self.target_radius*2, fill="red")
        
        
        self.score = 0
        self.speed = 5
        self.target_dx = self.speed
        self.target_dy = self.speed
        
        
        self.game_over = False
        
        
        self.canvas.bind("<Button-1>", self.on_click)
        
        
        self.game_loop()

    def game_loop(self):
        if self.game_over:
            return

        
        self.move_target()
        
        
        if self.is_target_out_of_bounds():
            self.handle_miss()

       
        if random.random() < 0.01:  
            self.speed += 1
            self.target_dx = self.speed * random.choice([-1, 1])
            self.target_dy = self.speed * random.choice([-1, 1])

        
        self.root.after(30, self.game_loop)

    def move_target(self):
        self.canvas.move(self.target, self.target_dx, self.target_dy)
        
        
        x1, y1, x2, y2 = self.canvas.coords(self.target)
        
        
        if x1 < 0 or x2 > 600:
            self.target_dx = -self.target_dx
        if y1 < 0 or y2 > 600:
            self.target_dy = -self.target_dy

    def is_target_out_of_bounds(self):
        x1, y1, x2, y2 = self.canvas.coords(self.target)
        return x2 < 0 or y2 < 0 or x1 > 600 or y1 > 600

    def on_click(self, event):
        if self.game_over:
            return
        
        
        x1, y1, x2, y2 = self.canvas.coords(self.target)
        click_x, click_y = event.x, event.y
        
        
        if x1 < click_x < x2 and y1 < click_y < y2:
            self.score += 1
            self.canvas.itemconfig(self.target, fill="green")
            self.canvas.after(100, self.reset_target)
        else:
            self.handle_miss()

    def handle_miss(self):
        if not self.game_over:
            miss_sound.play()
            self.canvas.config(bg="red")
            rage_sound.play()
            self.canvas.after(300, self.reset_game)

    def reset_target(self):
        self.canvas.itemconfig(self.target, fill="red")
        new_x = random.randint(50, 550)
        new_y = random.randint(50, 550)
        self.canvas.coords(self.target, new_x, new_y, new_x + self.target_radius*2, new_y + self.target_radius*2)

    def reset_game(self):
        self.game_over = True
        self.canvas.create_text(300, 300, text="GAME OVER", fill="white", font=("Helvetica", 24))
        self.canvas.create_text(300, 350, text=f"Final Score: {self.score}", fill="white", font=("Helvetica", 18))



root = tk.Tk()
game = RageGame(root)
root.mainloop()
